import React from 'react';
import Navbar from './Navbar';
import "./css/Startseite.css";

const Home = () => {
	
		return (
			<>
				<Navbar></Navbar>
				<a className="host_room" href="/host">
					Einen Raum erstellen
				</a>
				<a className="join_room" href="/join">
					Einen Raum beitreten
				</a>
			</>
		);
	};

export default Home;
